    render() {
        // const { listValue } = this.props;
        return (
            <ul className="list-group">
                {
                    this.props.listValue.map((item) => {
                        return <ListItem key={item.id} item={item} delTask={this.props.delTask}/>;

                    })  

                }

            </ul>
        )

    }
}


export default List;
